import React from 'react';
import { Image, TextInput, TouchableOpacity, View } from 'react-native';
import { StackNavigationProp } from '@react-navigation/stack';
import { RootStackParamList } from '../../../App';
import { faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons';

import styles from './styles';
import Footer from '../../components/Footer/Footer';
import { FontAwesomeIcon } from '@fortawesome/react-native-fontawesome';

const filterIcon = require('../../../assets/images/filter.png');

type Navigation = {
    navigation: StackNavigationProp<RootStackParamList>;
};

const CartScreen: React.FC<Navigation> = ({ navigation }) => {
    return (
        <View style={styles.container}>

            <View style = {styles.header}>
                <View style = {styles.ctnSearch}>
                    <FontAwesomeIcon icon = {faMagnifyingGlass} size={20} color='#7d7d80'/>
                    <TextInput 
                        placeholder='Tìm kiếm'
                    />
                </View>

                <View>
                    <TouchableOpacity>
                        <Image source={filterIcon} style = {styles.imgFilter}/>
                    </TouchableOpacity>
                </View>
            </View>

            <Footer navigation={navigation} address={"Cart"}/>
        </View>
    );
};

export default CartScreen;
